// MarshalJSON marshal bytes to json - template
func (j *Parameter) MarshalJSON() ([]byte, error) {
	var buf fflib.Buffer
	if j == nil {
		buf.WriteString("null")
		return buf.Bytes(), nil
	}
	err := j.MarshalJSONBuf(&buf)
	if err != nil {
		return nil, err
	}
	return buf.Bytes(), nil
}

// MarshalJSONBuf marshal buff to json - template
func (j *Parameter) MarshalJSONBuf(buf fflib.EncodingBuffer) error {
	if j == nil {
		buf.WriteString("null")
		return nil
	}
	var err error
	var obj []byte
	_ = obj
	_ = err
	buf.WriteString(`{ `)
	if len(j.Ref) != 0 {
		buf.WriteString(`"$ref":`)
		fflib.WriteJsonString(buf, string(j.Ref))
		buf.WriteByte(',')
	}
	if len(j.In) != 0 {
		buf.WriteString(`"in":`)
		fflib.WriteJsonString(buf, string(j.In))
		buf.WriteByte(',')
	}
	if len(j.Name) != 0 {
		buf.WriteString(`"name":`)
		fflib.WriteJsonString(buf, string(j.Name))
		buf.WriteByte(',')
	}
	if len(j.Description) != 0 {
		buf.WriteString(`"description":`)
		fflib.WriteJsonString(buf, string(j.Description))
		buf.WriteByte(',')
	}
	if j.Required != false {
		if j.Required {
			buf.WriteString(`"required":true`)
		} else {
			buf.WriteString(`"required":false`)
		}
		buf.WriteByte(',')
	}
	if j.Schema != nil {
		if true {
			buf.WriteString(`"schema":`)

			{

				err = j.Schema.MarshalJSONBuf(buf)
				if err != nil {
					return err
				}

			}
			buf.WriteByte(',')
		}
	}
	buf.Rewind(1)
	buf.WriteByte('}')
	return nil
}

